import React,{useEffect, useState} from 'react'

export default function TableData(props) {
  const {data} = props;
  return (
    <>
      {data.map((row) => {
        console.log(row);
        <tr>
        {props.headers.map((index) => {
          <td>{data[index]}</td>
        })}
        </tr>
      })}
    </>
  )
}
